description:
Star Fleet Project is a project of Brian May, most famous as the guitarist from Queen, which resulted in an album with the same name. The project was released as the work of &quot;Brian May + Friends&quot;, consisting of May, guitarist Eddie Van Halen, drummer Alan Gratzer (of REO Speedwagon), Phil Chen (session bassist who played with Jeff Beck and Rod Stewart), and Fred Mandel (session keyboard player who also played as additional keyboard player on Queen's Hot Space World Tour and The Works). Roger Taylor, Queen's drummer, provided backing vocals for the title song. It was not meant for the tapes to be released and they had minimal mixing before release.


